import React from "react";
import "./SearchBar.scss";
import shipments from "../../../assets/data/shipments.json";
import SearchBarItems from "./SearchBarItems/SearchBarItems";

const shipmentsArray = Object.values(shipments);

const SearchBar = () => {
  console.log(shipmentsArray[0].name)

  const inputFieldValue = document.querySelector('input')
  inputFieldValue.onkeyup = (e) => {
    console.log(e.target.value)
  }
  return (
    <div>
      <form className="form-search">
        <input className="input-search" id="input" type="search" placeholder="Search" />
        
        {shipmentsArray[0].map((el) => (
          <SearchBarItems key={el.name} url={el.id} name={el.name} />
        ))}
      </form>
    </div>
  );
};

export default SearchBar;
